function Main() {
    return (
        <main>

            <img src="/HomeImage.jpg" alt="Photo of 2 keen birdwatchers" />

            <p>
                Join our UK wide community of bird enthusiasts, discover the wonders
                of nature right at your door.
                People all over the UK contribute to our site advising of sightings,
                sending videos and providing care advice.
                Birdwatching is great to get outdoors and contributions to this site
                in the form of posts keep it going!
            </p>
        </main>

    )
}

export default Main;
